                        obj.const_normalization = 2;
                    otherwise
                        obj.map = [];
                        obj.qam_symbols = [];
                        obj.qam_idx = [];
                        obj.map([1,3]) =[];
                        obj.qam_real_bits = [];
                        obj.qam_im_bits = [];
                        obj.const_normalization = [];
                end
            end
                
                
        end
        function tps = Exctract_TPS(obj, frame)

            TPS_symb = frame(:, obj.TPS_K+1);
            tps = -1*ones(67,1);
            for j=2:68

                if mean(abs(TPS_symb(j,:) - TPS_symb(j-1,:))) < 1e-3
                    tps(j-1) = 0;
                else
                    tps(j-1) = 1;

                end
            end


        end

        function symb = Symb_Decistion(obj, data)
            [~, closest] = pdist2(obj.qam_symbols(:), data(:), 'euclidean', 'Smallest',1);
            symb = obj.qam_symbols(closest);
        end

        function bits = QAM2Bi(obj, ak)
            
            ak = ak*sqrt(obj.const_normalization);
            
            bits = zeros(length(ak),log2(obj.Modulacion));
            
            detec_r = obj.Symb_Decistion(real(ak));
            detec_i = obj.Symb_Decistion(imag(ak));
            
            ak_r = detec_r + obj.qam_idx;
            ak_i = detec_i + obj.qam_idx;

            

            sym_r = obj.map(ak_r);
            sym_i = obj.map(ak_i);

            bits(:,obj.qam_real_bits) = de2bi(sym_r, 'left-msb');
            bits(:,obj.qam_im_bits) = de2bi(sym_i, 'left-msb');

        end


        

        function k_idx = Sct_Pilots(obj,l)
            in = 3*mod(l,4);
            k_idx = in:12:obj.K_max;
        end

        function data = Exctract_Pilots(obj, symbols)
         
            num_symbols = size(symbols,2);
           
            
            symbols(:, obj.continual_pilot + 1) = 0;
            symbols(:, obj.TPS_K + 1) = 0;

            k_scatter_0 = obj.Sct_Pilots(0);
            k_scatter_1 = obj.Sct_Pilots(1);
            k_scatter_2 = obj.Sct_Pilots(2);
            k_scatter_3 = obj.Sct_Pilots(3);
            idx_1 = 0:4:num_symbols;
            idx_2 = 1:4:num_symbols;
            idx_3 = 2:4:num_symbols;
            idx_4 = 3:4:num_symbols;
            symbols(idx_1 + 1, k_scatter_0+1) = 0;
            symbols(idx_2 + 1, k_scatter_1+1) = 0;
            symbols(idx_3 + 1, k_scatter_2+1) = 0;
            symbols(idx_4 + 1, k_scatter_3+1) = 0;
            
            data = symbols.';
            data = nonzeros(data);

        end

        function idx_sync = Find_Sync(obj, TPS)
            idx_sync = 0;
            TPS = TPS(:).';
            

            sync_1 = strfind(TPS, obj.sync_tps(1,:));
            sync_2 = strfind(TPS, obj.sync_tps(2,:));

            if isequal(size(sync_1), [0,0])
                if isequal(size(sync_2), [0,0])
                    return
                else
                    idx_sync = sync_2;
                end
            else
                idx_sync = sync_1;
            end


        end


        function deintrlv_symb = Symb_Deintrlv(obj, intrl_data)

 
            deintrlv_symb = NaN;
            if mod(size(intrl_data,2), obj.N_max) ~= 0
                return;
            end
            
            m = size(intrl_data,2)/obj.N_max;
            deintrlv_symb = 3*zeros(size(intrl_data));
            c = 0;
            for j = 0:obj.N_max:m*obj.N_max-1
                idx = (j+1):(j+obj.N_max);
                if mod(c,2) == 0
                    deintrlv_symb(:,idx) = intrl_data(:, obj.H + c*obj.N_max);
                else
                    deintrlv_symb(:,obj.H + c*obj.N_max) = intrl_data(:,idx);
                end
                c= c+1;
            end

        end


        function deintrlv_bits = Bits_Deintrlv(obj,intrl_bits)
            deintrlv_bits = NaN;
            if mod(size(intrl_bits,2), 126) ~= 0
                return;
            end

            m = size(intrl_bits,2)/126;
            v= log2(obj.Modulacion);
            i = 0:v-1;
            e = fix(mod(i, v)/fix(v/2)) + 2*(mod(i,  fix(v/2)));

            idx = zeros(v, m*size(obj.H_bit,2));

            for i = 0:m-1
                idx(:, 126*i+1: 126*i+126) =  obj.H_bit(1:v,:) + 126*i;
            end
            
            deintrlv_bits = zeros(size(idx));
            
            for j = 1:size(idx,1)
                deintrlv_bits(j,idx(j,:)) = intrl_bits(j,:);
            end
            
            deintrlv_bits = deintrlv_bits(e+1,:);
            deintrlv_bits = deintrlv_bits(:);
        end

        function dec_vit = Viterbi_Dec(obj, data)

            trelis = poly2trellis(obj.len,obj.code_gen);
            dec_vit = vitdec(data , trelis, obj.tbdepth,'term', 'hard', obj.punc_pat);
        end

        function conv_deintrl = Conv_Deintrlv(obj, data)


            bits = reshape(data, 8,[])';
            symbs = bi2de(bits);
            r_deintrl = convdeintrlv(symbs, obj.nrows, obj.slope);
            conv_deintrl = r_deintrl(Decoder.D+1:end);
        end

        function [rs_decod, data_left] = RS_Deco(obj,data)
            trunc = floor(length(data)/(obj.n))*(obj.n);
            data_trunc = data(1:trunc);
            data_left = data(trunc+1:end);

            

            dec_g = gf(data_trunc,8,obj.p_gen);
            symbs = reshape(dec_g, obj.n,[])';
            decoded = rsdec(symbs,obj.n,obj.k);


            dec_data = decoded.x;
            rs_decod = reshape(dec_data',1,[]);

        end

    end

end